import React, { useState, useEffect, useCallback } from 'react';
import axios from 'axios';
import FlightCard from '../components/FlightCard';
import Payment from '../components/Payment';

const Flights = () => {
  const [flights, setFlights] = useState([]);
  const [from, setFrom] = useState('');
  const [to, setTo] = useState('');
  const [selectedFlight, setSelectedFlight] = useState(null);
  const [seats, setSeats] = useState(1);

  // ✅ Fetch Flights (with token authorization)
  const fetchFlights = useCallback(async () => {
    try {
      const token = localStorage.getItem('token'); // Get JWT token
      if (!token) {
        alert('Please log in to view flights');
        window.location.href = '/login';
        return;
      }

      const res = await axios.get('http://localhost:5000/api/flights', {
        headers: {
          Authorization: `Bearer ${token}`, // ✅ Attach token in header
        },
        params: {
          source: from,
          destination: to,
        },
      });

      setFlights(res.data);
    } catch (err) {
      console.error('❌ Error fetching flights:', err);
      alert('Failed to fetch flights. Please check backend or login again.');
    }
  }, [from, to]);

  // Handle search form submission
  const handleSearch = (e) => {
    e.preventDefault();
    fetchFlights();
  };

  // Handle flight selection
  const handleSelectFlight = (flight) => {
    setSelectedFlight(flight);
    setSeats(1);
  };

  // Fetch all flights on component mount
  useEffect(() => {
    fetchFlights();
  }, [fetchFlights]);

  return (
    <div style={{ padding: '1rem' }}>
      <h2 style={ {fontSize:'40px',color:'#fff' } }>✈️ Search Flights</h2>
      <form onSubmit={handleSearch} style={{ marginBottom: '1rem' }}>
        <input
          type="text"
          placeholder="From"
          value={from}
          onChange={(e) => setFrom(e.target.value)}
          style={{
            marginRight: '0.5rem',
            padding: '0.5rem',
            borderRadius: '6px',
            border: '1px solid #060639ff',
          }}
        />
        <input
          type="text"
          placeholder="To"
          value={to}
          onChange={(e) => setTo(e.target.value)}
          style={{
            marginRight: '0.5rem',
            padding: '0.5rem',
            borderRadius: '6px',
            border: '1px solid #ccc',
          }}
        />
        <button
          type="submit"
          style={{
            padding: '0.5rem 1rem',
            backgroundColor: '#007bff',
            color: 'white',
            border: 'none',
            borderRadius: '6px',
            cursor: 'pointer',
          }}
        >
          Search
        </button>
      </form>

      {/* Flights List */}
      <div>
        {flights && flights.length > 0 ? (
          flights.map((flight) => (
            <FlightCard
              key={flight._id}
              flight={flight}
              onSelect={() => handleSelectFlight(flight)}
            />
          ))
        ) : (
          <p>No flights found</p>
        )}
      </div>

      {/* Selected Flight & Payment */}
      {selectedFlight && (
        <div
          style={{
            marginTop: '2rem',
            padding: '1rem',
            border: '1px solid #ccc',
            borderRadius: '8px',
          }}
        >
          <h3>
            Booking for: {selectedFlight.airline} -{' '}
            {selectedFlight.flightNumber}
          </h3>
          <p>
            From: {selectedFlight.source} → To: {selectedFlight.destination}
          </p>
          <p>Price per seat: ₹{selectedFlight.price}</p>
          <input
            type="number"
            min="1"
            max={selectedFlight.seatsAvailable}
            value={seats}
            onChange={(e) => setSeats(Number(e.target.value))}
            style={{
              margin: '0.5rem 0',
              padding: '0.5rem',
              width: '80px',
              borderRadius: '6px',
              border: '1px solid #ccc',
            }}
          />
          <p>
            <strong>Total: ₹{selectedFlight.price * seats}</strong>
          </p>

          {/* Stripe Payment */}
          <Payment amount={selectedFlight.price * seats * 100} />
        </div>
      )}
    </div>
  );
};

export default Flights;
